    Description: 'What is Luminaria? You’ll have to experience it yourself to  find out, but we’ll do our best to give you an idea or two. Imagine all  the light displays you’ve seen before. Now, imagine something entirely  different and you’re on the right track. \r\n\r\nThis enchanting mile walk will transport you into a magical  holiday world as you make your way through the captivating Ashton  Gardens. The Grand Allee’s 8,000 programmable luminaries blanket the  sweeping hill, where each one acts as a pixel in a moving picture of  blooming poinsettias, flying reindeer, and dynamic symbols of the  season. And on top of that 40-foot hill, you’ll be met with the colossal  120-foot tree—all lit up and ready to be admired.\r\n\r\nLooking for a quiet moment of reflection? View the nativity  scene before entering the new Light of the World Garden. Glowing  lanterns and peaceful music accompany this space featuring 35 monument-  sized bronze sculptures depicting scenes of Jesus Christ from the New  Testament.\r\n\r\nContinue your holiday stroll while indulging all your senses in  special touches like s’mores at the glowing fire pits, hot chocolate  and sweets from the gift boutique, interactive game areas for children  and adults alike, even peppermint-scented mulch.\r\n\r\n___\r\n\r\nLuminaria. It’s a holiday spectacular that’s  unlike anything you’ve experienced before. Only at Thanksgiving Point.  Make this the first year of your new tradition and come experience the  light.\r\n\r\n*Dates and times are limited.  Purchase tickets in advance as we cannot guarantee the availability of walk-up tickets.*',
