    Description: 'This Holiday Season, join Microsoft and FutureINDesign (FIND) to raise funds for low-income youth pursuing careers in STEAM (Science, Technology, Engineering, Arts and Mathematics) related fields. \r\n\r\n \r\n\r\nTECH BAR TRIVIA NIGHT -- a playful giving event supporting FutureINDeisgn -- is a chance for ten companies to represent ten local youth in a trivia contest. Each company will bring two of their best and brightest employees to team up with 1 community leader and 1 FIND student to compete against other local contributors. At the end of the evening, the winning teams will award their student with a Microsoft Surface Pro 4 to aid them in their future studies. \r\n\r\n \r\n\r\n•          Public audiences will also have the opportunity to experience firsthand the brand new Surface Studio, VR (Virtual Reality) worlds, Xbox gaming and an interactive holiday photo booth.\r\n\r\n \r\n\r\n•          Donate to FIND at the event for a chance to win an Xbox One S!\r\n\r\n \r\n\r\nThis is a public event. All participants are welcome to bring family and friends to enjoy a fun night of community and emerging technology. \r\n\r\n \r\n\r\n \r\n\r\nRSVP on Facebook! https://www.facebook.com/events/661933153983365/\r\n\r\n \r\n  Visit us online at futureindesign.org',
