    Description: 'UNDERPRIVILEGED YOUTH ALONG WITH TECH GIANTS FROM SLC COMMUNITY TO PARTICIPATE IN BATTLE OF WITS GAME NIGHT\r\n\r\nTech Bar Trivia Night fundraiser to support youth pursuing careers in STEAM\r\n\r\nSALT LAKE CITY, Utah, Nov 29, 2016 – FutureINDesign today announced a game night fundraiser set up to help raise funds for and give computers to low-income youth pursuing careers in fields related to STEAM (science, technology, engineering, arts and mathematics) while honoring and celebrating tech giants in the community.\r\n\r\nTen companies represent ten youth in a trivia contest. Each company brings two of their best and brightest employees to team up with a community leader and youth each. This foursome, together, during a battle of wits, throws their best and brightest answers for their chance to win a Microsoft Surface Pro 4.\r\n\r\nEvent Details\r\n\r\nDate: December 1, 2016\r\n\r\nTime: 5-8 PM\r\n\r\nLocation: Microsoft City Creek, City Creek Center, 51 Main St #145, Salt Lake City, UT 84111\r\n\r\nCost: FREE\r\n\r\nPublic audiences will have the opportunity to experience firsthand the brand new Surface Studio, Virtual Reality worlds, Xbox gaming and an interactive holiday photo booth. Donate at the event to FIND for a chance to win an Xbox One S!  All participants are welcome to bring family and friends to enjoy a fun night of community and emerging technology. \r\n\r\n“We are committed to being a part of the fabric of the local communities in which we operate,” states Valeria Rodriguez, Microsoft Product Advisor in a statement. “We are excited to work with FutureINDesign, which is striving to do the same by increasing opportunities for Utah’s under-represented young adults. We hope this event will not only capture the hard work that FIND and its partners have contributed, but also showcase a program full of possibilities for at-risk youth. Communities everywhere should be apprised of the need to narrow the digital literacy gap through programs like FIND.” \r\n\r\n“Pluralsight’s mission has always been and always will be to democratize technology education,” explains Isaac Strack, Senior Content Strategist for Pluralsight.  “Trivia night is an opportunity to raise awareness, to celebrate something that is truly amazing and, of course, to have some fun!” \r\n\r\n“Our team’s mission is to build and promote a vibrant STEAM culture in Utah that nurtures, attracts and inspires the best and brightest workforce, while strengthening Adobe’s brand of innovation,” explains Brad Daw, Computer Scientist and Software Developer for Adobe and part of the Adobe Steam Team. “We hope to accomplish several things as we participate with FutureINDesign, including encouraging positive contributions to society through technology, supporting STEAM Education and Education Policy on the Hill, and ensuring that our Utah talent pipeline has the interest and skills to ‘Change the world through digital experiences’.” \r\n\r\n“70 percent of people believe that women don’t belong as authorities in architecture. I know I can prove them wrong,” explains one young, hope-filled participant, currently plowing through the beginnings of her schooling in architecture and design.  \r\n\r\n When asked about their legacy, here were a few FutureINDesign students’ responses:\r\n\r\n• “I want to be an example for other people from my [diverse] community.”\r\n\r\n• “I want to motivate other women, especially refugee women. I want them to know to never doubt themselves. We are capable of anything.”\r\n\r\n• “Sometimes I feel like I am a target and that people don’t want me in the workforce. I want to change that for younger generations.” \r\n\r\n“Partners and allies, come for a glimpse into the amazing paths our work together is forging for these young people,” urges Nicholina Womack, CEO and Founder of FutureINDesign. “These young people are more than eager to make change for themselves and leave a legacy for others as well. Please join us for our event and meet these young adults yourself and hear their incredible stories.”\r\n\r\n###\r\n\r\n**About FIND:** FutureINDesign, dedicated to STEAM career development for marginalized youth, is a Utah-based 501 (c)(3) organization founded in 2015. Its mission is to narrow the digital literacy gap in Utah through immersive training in key technology and life skills, thereby reducing constraints of intergenerational poverty and creating a pipeline of talent for our community’s growing tech workforce.  \r\n\r\nContact Information Liz Coleman   |   206.512.6570   elizabethevacoleman@gmail.com',
