    Description: 'Part I: Managing Your Cash Flow \r\nThe Number One reason businesses fail is that they run out money\\! \r\nCome learn what most small businesses owners do not know to help avoid the ruin of your company \r\nWhy you have so little cash when your income statement shows a good profit?\r\nWhy you can be profitable, but still go bankrupt\\. \r\nWhy your primary focus needs to be on maximizing cash flow, not on profits\\. \r\nWhy using your bank ledger as the primary way to manage cash flow is not a good thing to do\\. \r\nWhat are the tools you have to maximize your cash flow\\. \r\nHow can you use financial statements to manage your cash \r\nflow\\. \r\nOver 20 years of small business finance experience \r\nAdjunct professor of finance at Webster University, Hill AFB \r\nWhere to  nd cash in your company\\. \r\nHow to use debt as a tool and not a crutch\\.',
