    DateStart: '2016-12-01T18:30:00Z',
    Description: 'As an entrepreneur, it can be confusing and overwhelming to know where to start or what to do. Do you struggle with…. \r\n\r\nStress and overwhelm, not knowing where to start and how to find new clients? \r\n___\r\n\r\nSelf Sabotage in not following through on what you know?\r\n___\r\n\r\nGetting it all done and still having a home life? \r\n___\r\n\r\nAre you tired of wasting time and money trying to find clients? \r\n\r\nAs a small business owner, we don\'t generally have a team working with us. Many of us do the slipper commute (work from home) or work on our own. It can feel confusing, frustrating and isolating…\r\n\r\n___\r\n\r\nBut you don\'t have to go it alone. \r\n\r\n___\r\n\r\nMy first 3 years in business, I struggled needlessly. I wasted thousands of dollars in marketing and thousands of hours. I spent thousands on business education - and eventually I learned the psychology of marketing and sales. \r\n\r\n___\r\n\r\nBut it wasn\'t enough just to know what to do- you also have to follow through on what you know. And that\'s why I created this program. \r\n\r\n___\r\n\r\nIt combines 6 weeks of lessons on the essential topics of running a business, finding clients and making your first 100 sales. It\'s structured with both interactive know how of the psychology of marketing and sales and knowing exactly what to do to attract clients. Learn about the 6 Key Areas of Business: Marketing, Sales, Cash Flow, Motivation, Productivity, Building Your Team and more!\r\n\r\n___\r\n\r\nPlus, get your BRAIN out of: Overwhelm, Lack of Motivation, Low Confidence and Self Sabotage and set up your Brain for Focus, Drive and Consistent Action so you can Succeed!\r\n\r\n___\r\n\r\nHere\'s the Lessons included in Brain Power Your Small Business with Hypnosis: \r\n\r\nLesson 1:  Visioneering Your Business. Designing your business to fit your life and clarifying your purpose, mission and vision.  Anything you want to achieve in life always starts with Vision and your Belief your Success.  Hypnosis: Visioneer Your Future\r\n___\r\n\r\nLesson 2:  The Power of Words + Word of Mouth Marketing. When you understand the psychology of words, you can get really clear about your message and your market. Develop your brand, your elevator pitch, your tagline and more. Define who you are talking to and how to talk about your business. Hypnosis: Attract Clients Now \r\n___\r\n\r\nLesson 3: Psychology of Sales. Know what people look for before they buy. Learn the skills to make sales easy and comfortable. Plus, understand the principles of your business brand, reputation and how to get referrals. Hypnosis: Step Into Confidence\r\n___\r\n\r\nLesson 4: Create Ease with Money. If you have stress habits with money, your mind could be repelling the very money you desire - creating sabotage and costing you clients. Learn the best money practices for your business. Plus, identify and clear any money blocks that are stopping so you can release self sabotage around money and create ease and flow. Hypnosis: Train Your Brain for Wealth & Prosperity\r\n___\r\n\r\nLesson 5: 44 Marketing Strategies After this class, you\'ll always know what to do and where to go to find clients. Map out the best strategies for you and your business,  develop your plan and create a steady flow of clients. Hypnosis: Overwhelm to Organized! \r\n___\r\n\r\nLesson 6: Keep Clients Coming Back. Learn what it takes to keep clients coming back. It costs 50% more to keep finding new clients. Learn strategies to stay in touch and stay connected with clients, keep them coming back -and get referrals. Hypnosis: Systems & Flow in Business\r\n___\r\n\r\nYou don\'t have to struggle like I did. Don\'t waste your time and money while struggling to survive in business. \r\n\r\n___\r\n\r\nThe number 1 reason small businesses fail is lack of marketing and finding clients. Over the last 10 years of running my business and starting from ground zero - TWICE - I\'ve found what works. \r\n\r\n___\r\n\r\nPlus, I\'ve worked with over 1,000 business owners on Motivation, Confidence, Focus, Strategy and more.   Let me share with you the Know How AND The Brain Skills to attract clients and grow your business.\r\n\r\n___\r\n\r\nIf you\'re a small business owner, I know you have a vision and passion to bring your business to the world. And if you\'re like most of us, you truly want to help people. For many of us solopreneurs - our businesses are the vehicle to bring our life purpose, mission and vision to the world.\r\n\r\n___\r\n\r\nJoin other entrepreneurs for feedback, focus, motivation, confidence and more. \r\n\r\nMeet Online or In Person in Salt Lake City, UT at Life Harmony Wellness Center: 555 E. 4500 S. Suite C-250, Murray, UT 84107\r\n\r\n___\r\n\r\nSee details and Register at: http://thebraintrainerllc.com/business/brain-power-small-business-hypnosis/ \r\n\r\n___\r\n\r\nHolly Stokes, The Brain Trainer, has more than 20 years experience in the field of applied psychology.  Through Neuro-Linguistic Programming (NLP), Hypnosis and Coaching, she loves empowering clients to lead healthier, happier lives by engaging the power of the mind.   She has authored two books and created several CDs designed to rewire the brain for weight loss, health, happiness and success and loves to empower people with \'Brain Skills\' for life.  She has been quoted by Shape Magazine, Active Times and Chicago Tribune and appears on radio shows and local TV. She says, "Whatever you want to create in your life - the answers are in your brain."',
