    Description: 'Cha Cha is upbeat and exciting, and will challenge your mind and body as you learn the steps, technique, and choreography to make a great routine while working with great people\\!\r\n\r\nAnyone with a little dance experience can join, no partner required\\. Participants don’t need Cha Cha experience, but should have a month or two of some dance style under their belts\\. If you consider yourself a beginner/intermediate dancer, this course is for you\\!\r\n\r\nThursdays 12\\.01 \\- 03\\.02 from 7\\-7:50pm \\(no classes 12\\.22 & 12\\.29 because let\'s face it, everyone is BUSY during the holidays\\!\\)\r\n\r\nThis Cha Cha group will meet every week for 12 weeks \\- culminating in a performance at DF\'s Fire & Ice Ball on Saturday March 4\\. You’ll get an in\\-depth experience with the Cha Cha style and build great friendships with people in the group\\!\r\n\r\nCost: $10 per class for 12 wks, paid upfront \\- $120 total – No costume fees or team fees – we’ll keep it simple\\.\r\n\r\nBONUS: For a limited time, with the purchase of this 12 wk Cha Cha Challenge you can purchase 12 wk Social Dance Crash Course \\(which will cover Swing, Foxtrot, Nightclub 2 Step, & Rumba\\) for 50% off\\! Crash Course runs parallel with Cha Cha on Thursdays at 8pm, so you get more dance experience & meet more people\\! Call 801\\.466\\.0490 to get this deal\\.\r\n\r\nhttp://www\\.dfdancestudio\\.com/cha\\-cha\\-challenge\r\n2978 S State St SLC\r\n801\\.466\\.0490',
