    Description: 'Dan Holland, an animator for Pixar Animation\r\n\r\n___\r\n\r\nStudios, will be presenting an artist talk at the Southern Utah Museum of Art on December 1,\r\n\r\n___\r\n\r\n2016, at 7:00 pm. Holland’s presentation is part of the Art Insights series hosted by SUU’s Art &amp;\r\n\r\n___\r\n\r\nDesign Department. Admission is free, and the general public is invited to attend.\r\n\r\n___\r\n\r\nHolland studied art and film at Brigham Young University and animation at The Vancouver Film\r\n\r\n___\r\n\r\nSchool. He received his BFA in character animation from the California Institute of the Arts.\r\n\r\n___\r\n\r\nHolland currently works at Pixar Animation Studios. Holland has worked as an animator, sketch\r\n\r\n___\r\n\r\nartist, and art director at Pixar over the last 12 years. His latest project was as sets art director\r\n\r\n___\r\n\r\non the feature film Inside Out. He has taught and lectured for the past 10 years on character\r\n\r\n___\r\n\r\nand animation design.\r\n\r\n___\r\n\r\nA love of animated films led Holland to become an artist. He describes his work as creative\r\n\r\n___\r\n\r\nproblem solving in the most entertaining way possible. While working on a design, Holland and\r\n\r\n___\r\n\r\nhis fellow animators at Pixar often use the phrase ‘Push it to 11’. Holland says this encourages\r\n\r\n___\r\n\r\nhis creativity so he can push the design as far as it can go, and then some.\r\n\r\n___\r\n\r\nWhen asked where he finds his inspiration for art, Holland said, “Where DON’T I find it? The\r\n\r\n___\r\n\r\nmost fulfilling part of my work as an artist is distilling life into something fresh. I enjoy the\r\n\r\n___\r\n\r\nresearch and the process rather than the final product.”\r\n\r\n___\r\n\r\nHolland’s Art Insights presentation will cover his personal inspiration, design philosophy and\r\n\r\n___\r\n\r\nmethod, as well as what it takes to collaborate with a team of artists. He will also discuss some\r\n\r\n___\r\n\r\nof his experiences from his work at Pixar.\r\n\r\n___\r\n\r\nArt Insights is hosted during the fall and spring semesters by SUU’s Art &amp; Design faculty.\r\n\r\n___\r\n\r\nStudents and community members meet to experience presentations and discussions by\r\n\r\n___\r\n\r\nvisiting artists and art educators from around the nation who share their work and insights.\r\n\r\n___\r\n\r\nAbout the College of Performing and Visual Arts\r\n\r\n___\r\n\r\nThe Southern Utah University College of Performing and Visual Arts is comprised of nationally\r\n\r\n___\r\n\r\naccredited departments of Art and Design, Music, and Dance. The College also offers programs\r\n\r\n___\r\n\r\nin Theatre Arts, graduate programs in Arts Administration and Music, as well as a Center for\r\n\r\n___\r\n\r\nShakespeare Studies. The College offers 16 different degree areas, including liberal arts\r\n\r\n___\r\n\r\nBachelor of Arts and Bachelor of Science degrees; professional Bachelor of Music and Bachelor\r\n\r\n___\r\n\r\nof Fine Arts in art and theatre degrees; and Master of Fine Arts in Arts Administration, Master of\r\n\r\n___\r\n\r\nArts in Arts Administration, Master of Music Education and Master of Music in Music Technology\r\n\r\n___\r\n\r\ngraduate degrees. More than 60 full- and part-time faculty and staff are engaged in teaching\r\n\r\n___\r\n\r\nand mentoring nearly 600 majors in the College. Over 1,100 students enroll each year in over\r\n\r\n___\r\n\r\n195 arts classes on the SUU campus. The College presents over 100 performances, lectures,\r\n\r\n___\r\n\r\npresentations, and exhibitions each year. The College’s affiliate organizations include the\r\n\r\n___\r\n\r\nSouthern Utah Museum of Art (SUMA), Utah Shakespeare Festival and SUU’s Ballroom Dance\r\n\r\n___\r\n\r\nCompany. For more information about the College of Performing and Visual Arts, visit\r\n\r\n___\r\n\r\nwww.suu.edu/pva.\r\n\r\n___\r\n\r\nFor Calendar Editors: Find Your Inspiration with Pixar’s Dan Holland\r\n\r\n___\r\n\r\nWhat: Dan Holland, an animator for Pixar Animation Studios, will be presenting an\r\n\r\n___\r\n\r\nartist talk at the Southern Utah Museum of Art on December 1, 2016, at 7:00 pm.\r\n\r\n___\r\n\r\nHolland’s presentation is part of the Art Insights series hosted by SUU’s Art &amp;\r\n\r\n___\r\n\r\nDesign Department. Admission is free, and the general public is invited to attend.\r\n\r\n___\r\n\r\nWho: Art Insights, Southern Utah University, Department of Art &amp; Design\r\n\r\n___\r\n\r\nWhen: Thursday, December 1, 2016\r\n\r\n___\r\n\r\nTime: 7:00 p.m.\r\n\r\n___\r\n\r\nWhere: Southern Utah Museum of Art, 13 S 300 W, Cedar City, Utah\r\n\r\n___\r\n\r\nTickets: Free admission, General Public invited to attend\r\n\r\n___\r\n\r\nInfo: Visit www.suu.edu/pva for more information',
