    Description: 'Whether you’re a complete beginner taking your first country class OR a more experienced dancer with some country dancing knowledge, this Country Western Crash Course will shape you into the person on the dance floor that everyone wants to be\\! After just 12 wks, you’ll know how to Country Swing, Two Step, & Line Dance so you can have a blast on those evenings at country bars and clubs\\. \r\nWhy: Country is a relaxed, fun style of dance that you can do to most any music\\! Be confident when the music comes on at parties, weddings, & bars by learning country moves\\.\r\nWhen: This is a 12 wk course held on Thursdays at 7pm – class is 50 minutes\\. Start Dec 1, join by Dec 8 at the latest, no classes Dec 22 & 29 for the holidays\r\nCost: During the first 2 wks, you can drop in for $15 a class to try it out; When you buy the whole course, you get a discounted rate of $10 per class \\- $120 total for 12 wks\\. Bonus: FREE practice sessions on Thursdays at 6pm when you buy the whole course\\.\r\nhttp://www\\.dfdancestudio\\.com/country\\-dancing\\.html\r\n801\\.466\\.0490\r\nDF Dance Studio\r\n2978 S State St SLC',
