    Description: 'If you love 60’s girl group pop music and you also love Christmas, then you are in for a real treat\\.  “The Winter Wonderettes” follows Missy, Suzy, Betty Jean, and Cindy Lou as they sing favorite holiday classics with a new spin, like Santa Clause is Coming to Town, Jingle Bell Rock, and Santa baby\\.  Audiences will feel like singing along and dancing in the aisle as the Wonderettes take us back to a more innocent time\\.\r\n \r\nIt’s 1968 and the Wonderettes are the entertainment for Harpers Hardware Holiday party\\.   When Santa \\(aka the boss, Mr\\. Harper\\) is a no\\-show, the ladies find that it’s up to them to make sure the evening is filled with Christmas cheer and everyone has a Merry Christmas\\.\r\n \r\nDirected by Addison Welch and lead by the loveable cast of Wonderette Women: Mollee Steel \\(Missy\\), Kirsten Jacobsen \\(Cindy Lou\\), Kenzie Stinger \\(Suzy\\) and Tatiana Quinn \\(Betty Jean\\) this production of “The Winter Wonderettes” is sure to be your new holiday favorite\\.',
