    Description: 'Dan Waldis “A Little Jazz With Your Mistletoe” Night One is a great way  to start the Christmas season! Special guest singer, the lovely Allison  Ottley joins the group to bring her silvery voice to the group of some  of the best jazz musicians around. Dan Waldis on piano, Dave Halliday on  sax, Steve Brown on bass, and Dave Murphy on percussion with Allison  Ottley on vocals. The unique jazz arrangements of familiar traditional  Christmas favorites are Dan’s specialty. “A Little Jazz With Your  Mistletoe” has become a family a favorite for many years. Jazz fans and  music lovers alike join with us in the celebration! We hope you’ll start  your tradition with us this year and enjoy two great evening  performances – come for one night or two!! See you there!',
