    Description: 'Fresh off his debut television appearance on Live at Gotham and the release of his debut comedy special I Got Questions, award-winning stand-up comedian John Crist continues to gain momentum as one of America’s young rising stars of comedy. Crist’s style of edgy but clean comedy keeps him on the road for a whirlwind schedule of over 250 live shows per year. A regional finalist in Comedy Central’s Up Next Competition and over 10 million Buzzfeed views, Crist just returned from a USO Comedy Tour for the Troops in Kuwait…all while headlining top comedy clubs across the country and sharing the stage with the likes of Dave Chappelle, Seth Meyers, Tim Hawkins,Chris D’Elia, and Anjelah Johnson.\r\n\r\nFrom joking about texting and driving and the ills of social media, telling people their children aren’t winners, or breaking out into choreographed dances in Hobby Lobby, Crist performs from a point of view that’s distinctly his own.',
